import { Box, Flex, Image, Stack } from "@chakra-ui/react";


function Footer() {

    return (

        <Stack>
            <Box back>
            <Flex>
                <Box>

                </Box>

                <Box>
                    <Image src="https://www.getharvest.com/hubfs/raw_assets/public/harvest-theme/images/illoglyphs/footer-illo-comp.svg" alt="" />
                </Box>
            </Flex>
            </Box>
        </Stack>
    )
}

export default Footer;
